    useEffect(() => {
        fetch('http://localhost:5000?email='+loggedInUser.email, {
            method: 'GET'
        })
    }, [])

    return (
        <div className='container'>
            <div className="order-card">

            </div>
            <h3>This is order page</h3>
        </div>
    );
};

export default Orders;
